import Typed from 'react-typed';


const StartingPageContent = () => {
  return (
    <div className=" mx-auto   w-95   rounded-md h-screen  shadow-md p-10 text-center  flex-row justify-center items-center h-96 my-5 mx-5 bg-gray-200">
      <h2 className='my-8 text-3xl text-red-800  '>Welcome on Evrima!</h2>
      <Typed
                strings={[
                    'Search for products',
                    'Search for categories',
                    'Search for brands']}
                    typeSpeed={40}
                    backSpeed={50}
                    attr="placeholder"
                    loop >
                    <input className="ml-2 bg-transparent text-gray-800    " type="text"/>
                </Typed>
    </div>
  );
};

export default StartingPageContent;
